message:
TRADUÇÃO AUTOMÁTICA DO YOUTUBE PELO CELULAR 


Amigos, "alguns" vídeos do YouTube, permitem ativar as legendas em português utilizando o celular, e  para assistir com as legendas ativadas, sigam os passos: 
✨Abra o vídeo;
✨Toque na tela do celular;
✨ Entre na engrenagem ( no canto superior direito);
✨ Legendas;
✨ Tradução automática;
✨ Português
